import React, { useState } from "react";
const Header = ()=>{
    return(
        <header>
            <a href="" className="Logo">My Blog</a>
            <nav>
            <a href="" className="nav-icon" >Rgister</a>
            <a href="" className="nav-icon">Login</a>
            <a href="" className="nav-icon">Blog</a>
            </nav>
        </header>
    )
}

export default Header;
